import React, { Component } from 'react';
import Runtime from './Runtime';

class Dial extends Component {
  render() {
    return (
    	<div class="container-fluid call-phone">
    		<Runtime/>
            <div class="hangup">
                <div className="Dial">
                <div className="col-5">
                    <div className="mute"><i class="fas fa-microphone-slash"></i></div>
                </div>
            </div>
            </div>
            <FontAwesome
        className='super-crazy-colors'
        name='rocket'
        size='2x'
        spin
        style={{ textShadow: '0 1px 0 rgba(0, 0, 0, 0.1)' }}
      />
    	</div>
    );
  }
}

export default Dial;
